import { useState, useEffect, useContext } from 'react';
// import { useSelector } from 'react-redux';
import { useDispatch } from 'react-redux';

import Expence from '../components/Expences/Expence';
import NewExpense from '../components/Expences/NewExpense';
import {AddExpence} from '../store/expences-slice'
import AuthContext from '../store/AuthContext';

const DUMMY_EXPENSES = [
  {
    id: 'e1',
    title: 'Toilet Paper',
    amount: 94.12,
    date: new Date(2020, 7, 14),
  },
  { id: 'e2', title: 'New TV', amount: 799.49, date: new Date(2021, 2, 12) },
  {
    id: 'e3',
    title: 'Car Insurance',
    amount: 294.67,
    date: new Date(2021, 2, 28),
  },
  {
    id: 'e4',
    title: 'New Desk (Wooden)',
    amount: 450,
    date: new Date(2021, 5, 12),
  },
];

function HomePage() {

  const [expenses, updateExpence] = new useState(DUMMY_EXPENSES);
  const [newExpenseYear, setnewExpenseYear] = new useState("2022");
  // const expence = useSelector((state) => state.expences);
  const dispatch = useDispatch();
  const ctx = useContext(AuthContext);

  useEffect(() => {
    // debugger
    // fetch(
    //   "https://expencetracker-b3897-default-rtdb.firebaseio.com/expence.json",
    //   {
    //     method: "put",
    //     body: JSON.stringify({
    //       description: "test",
    //       amount: "100",
    //     }),
    //     headers: {
    //       'Content-Type': "Application/Json"
    //     }
    //   }
    // );
  }, []);

  const newExpencefilter = function(filterechangeHanler) {
      return filterechangeHanler;
  }

  const onChangeFilter = (year) => {
    setnewExpenseYear(year);
  }
  const expense = function addExpence(newexpence) {
    dispatch(AddExpence(ctx.email))

    // DUMMY_EXPENSES.push(newexpence)
    updateExpence((previousExpence) => {
      setnewExpenseYear(newexpence.date.getFullYear().toString());
      return [newexpence, ...previousExpence];
    });
  }

  return (
    <div>
      <NewExpense addExpence={expense} newExpenseYear={newExpencefilter}/>
      <Expence expenses={expenses} newExpenseYear={newExpenseYear} onChangeFilter={onChangeFilter}/>
    </div>
  );
}

export default HomePage;
